import styled from "styled-components";

export const HomepageContainer = styled.div`
    display: flex;
    flex-direction: column;
    gap: 60px;
    margin: 0 16px;

    @media (min-width: 768px) {
        margin: 0 24px;
    }

    @media (min-width: 1024px) {
        margin: 0 32px;
    }
`;
